import React from "react";

const Header = () => {
  return (
    <header style={{ textAlign: "center", margin: "20px 0" }}>
      <h1>Welcome to Agent Mob</h1>
      <p>Configure your AI agents and surveys with ease.</p>
    </header>
  );
};

export default Header;
